import axios from 'axios';
import React from 'react';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';
import './InsertModal.css'

export default  class InsertModal extends React.Component{ 
    constructor(props){
        super(props)
        this.state ={
            course: "",

        }
    }

    handleCourseNameChange = (event) =>{
        this.setState({
            course: event.target.value
        })
    }


    onDeleteClick = (event) =>{
        console.log("course: ", this.state)
        axios.delete(`http://localhost:5000/api/courses/${this.state.course}`)
        .then(function(response){
            console.log(response)
            alert(`Deleted ${this.state.course}`)
        })
        .catch(function(error){
            console.log(error)
        })
        event.preventDefault()
    }

    render(){
        return(
            <Popup
            trigger={<button className="button"> Delete a Course </button>}
            modal
            nested
          >
            {close => (
              <div className="modal">
                <button className="close" onClick={close}>
                  &times;
                </button>
                <div className="header"> Delete a Course </div>
                <div className="content">
                    <form onClick={this.onDeleteClick}>
                        <div>
                            <label>Course Name</label>
                            <input type="text" value={this.state.course} onChange={this.handleCourseNameChange}/>
                        </div>


                        <button className="button"> Delete </button>
                        <button
                            className="button"
                            onClick={() => {
                            console.log('modal closed ');
                            close();
                            }}
                        >
                            Close
                        </button>
                    </form>
                </div>




              </div>
            )}
          </Popup>
        )
    }

};
